  fileSelected(event) {
    const selectedFile = event.target.files[0];
    if (selectedFile) {
      const allowedExtensions = ['.xls', '.xlsx'];
      const fileExtension = selectedFile.name.slice((selectedFile.name.lastIndexOf(".") - 1 >>> 0) + 2).toLowerCase(); // Ensure lowercase comparison
      if (allowedExtensions.includes(`.${fileExtension}`)) {
        const reader = new FileReader();
        reader.onload = e => {
          const data = new Uint8Array(e.target.result);
          const workbook = xlsx__WEBPACK_IMPORTED_MODULE_4__.read(data, {
            type: 'array'
          });
          const sheetName = workbook.SheetNames[0];
          const worksheet = workbook.Sheets[sheetName];
          const headerRange = xlsx__WEBPACK_IMPORTED_MODULE_4__.utils.decode_range(worksheet['!ref']);
          const columnNames = [];
          for (let C = headerRange.s.c; C <= headerRange.e.c; ++C) {
            const cellAddress = {
              c: C,
              r: headerRange.s.r
            };
            const cellRef = xlsx__WEBPACK_IMPORTED_MODULE_4__.utils.encode_cell(cellAddress);
            const cell = worksheet[cellRef];
            columnNames.push(cell.v);
          }
          if (columnNames.length >= 2 && columnNames[0] === 'Employee Name' && columnNames[1] === 'Employee ID') {
            this.selectedFileName = selectedFile.name;
            this.formData = new FormData();
            this.formData.append('file', selectedFile);
          } else {
            this.selectedFileName = '';
            this.formData = null;
            alert('Uploaded file does not meet the required format (column names mismatch).');
          }
        };
        reader.readAsArrayBuffer(selectedFile);
      } else {
        this.selectedFileName = '';
        this.formData = null;
        alert('Only Excel files (.xls and .xlsx) are allowed.');
      }
    } else {
      this.selectedFileName = '';
      this.formData = null;
    }
  }
