  getFormattedReasons(rejectionReasons) {
    const reasonsList = rejectionReasons.split(',').map(reason => reason.trim()).filter(reason => reason !== '');
    if (reasonsList.length > 0) {
      return reasonsList.join(', ');
    } else {
      return rejectionReasons.trim();
    }
  }
